import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import heroBg from "../images/hero-bg.jpg";

const Partnership = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search data:", formData);
  };

  return (
    <div className="min-h-screen relative">
      {/* 半透明的背景图片 */}
      <div className="absolute inset-0">
        <img
          src={heroBg}
          alt="Background"
          className="w-full h-full object-cover"
          style={{ filter: "brightness(0.7) saturate(0.7)" }}
        />
        <div className="absolute inset-0 bg-cyan-900/30 mix-blend-multiply" />
      </div>

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(-1)}
        className="absolute top-8 left-8 text-white hover:text-cyan-100 transition-colors z-10"
      >
        <svg
          xmlns="http://www.w3.org/2000/svg"
          className="h-8 w-8"
          fill="none"
          viewBox="0 0 24 24"
          stroke="currentColor"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth={2}
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 flex flex-col items-center justify-center min-h-screen px-4">
        <h1 className="text-5xl font-bold text-white mb-12 text-center">
          Let's Find Your Perfect Partner
        </h1>

        <div className="w-full max-w-4xl bg-white/95 rounded-2xl shadow-xl p-8">
          <form onSubmit={handleSubmit} className="space-y-6">
            <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
              {/* Location Input */}
              <div>
                <label
                  htmlFor="location"
                  className="block text-sm font-medium text-gray-700 mb-2"
                >
                  Location
                </label>
                <input
                  type="text"
                  id="location"
                  name="location"
                  value={formData.location}
                  onChange={handleChange}
                  placeholder="Enter location"
                  className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-cyan-500 focus:border-transparent transition-all"
                />
              </div>

              {/* Organization Type Select */}
              <div>
                <label
                  htmlFor="orgType"
                  className="block text-sm font-medium text-gray-700 mb-2"
                >
                  Organization Type
                </label>
                <select
                  id="orgType"
                  name="orgType"
                  value={formData.orgType}
                  onChange={handleChange}
                  className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-cyan-500 focus:border-transparent transition-all"
                >
                  <option value="">Select type</option>
                  <option value="nonprofit">Nonprofit</option>
                  <option value="forprofit">For-Profit</option>
                  <option value="social">Social Enterprise</option>
                  <option value="government">Government</option>
                </select>
              </div>
            </div>

            {/* Partnership Goal Textarea */}
            <div>
              <label
                htmlFor="partnershipGoal"
                className="block text-sm font-medium text-gray-700 mb-2"
              >
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                id="partnershipGoal"
                name="partnershipGoal"
                value={formData.partnershipGoal}
                onChange={handleChange}
                rows={4}
                placeholder="Describe your ideal partnership..."
                className="w-full px-4 py-3 rounded-lg border border-gray-300 focus:ring-2 focus:ring-cyan-500 focus:border-transparent transition-all"
              />
            </div>

            {/* Search Button */}
            <div className="flex justify-center">
              <button
                type="submit"
                className="px-8 py-3 bg-cyan-600 hover:bg-cyan-700 text-white rounded-lg transition-colors duration-200 font-medium text-lg"
              >
                Find Partners
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Partnership;
